import React from 'react';

const Form = () => {
    return (
        <form>
            <label htmlFor="email">Email:</label>
            <input type="text" name="email" />
            <br />
            <label htmlFor="password">Password:</label>
            <input type="text" name="password" />
            <br />
            <button>Submit</button>
        </form>
    )
}
export default Form;
